import React from 'react';
import { Link } from 'react-router-dom';
import ResponsiveMenu from 'react-responsive-navbar';

class Nav extends React.Component {
    render() {
        return (
            <nav>
                <ResponsiveMenu
                    menuOpenButton={<svg fill="currentColor" preserveAspectRatio="xMidYMid meet" height="30" width="30" viewBox="0 0 40 40" style="vertical-align: middle; color: mediumpurple;"><g><path d="m37.3 30v2.9q0 0.5-0.4 1t-1 0.4h-31.5q-0.6 0-1-0.4t-0.4-1v-2.9q0-0.6 0.4-1t1-0.4h31.5q0.5 0 1 0.4t0.4 1z m0-11.4v2.8q0 0.6-0.4 1t-1 0.5h-31.5q-0.6 0-1-0.5t-0.4-1v-2.8q0-0.6 0.4-1t1-0.5h31.5q0.5 0 1 0.5t0.4 1z m0-11.5v2.9q0 0.6-0.4 1t-1 0.4h-31.5q-0.6 0-1-0.4t-0.4-1v-2.9q0-0.5 0.4-1t1-0.4h31.5q0.5 0 1 0.4t0.4 1z"></path></g></svg>}
                    menuCloseButton={<svg fill="currentColor" preserveAspectRatio="xMidYMid meet" height="30" width="30" viewBox="0 0 40 40" style="vertical-align: middle; color: mediumpurple;"><g><path d="m33.5 29.5q0 0.9-0.7 1.5l-3 3.1q-0.6 0.6-1.5 0.6t-1.5-0.6l-6.6-6.6-6.5 6.6q-0.7 0.6-1.6 0.6t-1.5-0.6l-3-3.1q-0.6-0.6-0.6-1.5t0.6-1.5l6.5-6.6-6.5-6.5q-0.6-0.7-0.6-1.6t0.6-1.5l3-3q0.6-0.6 1.5-0.6t1.6 0.6l6.5 6.6 6.6-6.6q0.6-0.6 1.5-0.6t1.5 0.6l3.1 3q0.6 0.7 0.6 1.5t-0.6 1.6l-6.6 6.5 6.6 6.6q0.6 0.6 0.6 1.5z"></path></g></svg>}
                    changeMenuOn="500px"
                    largeMenuClassName="large-menu-classname"
                    smallMenuClassName="small-menu-classname"
                    menu= {
                            <ul>
                                <li><Link to="/">Home</Link>   </li>
                                <li><Link to="/about-us">Meet the Band!</Link></li>
                                <li><Link to="/contact-us">Book a Gig!</Link></li>
                                <li><Link to="/gallery">Gallery</Link></li>      
                            </ul>
                    }
                />    
            </nav>
        )
    }
}

export default Nav;
